    "Crosby Wetland Management District (including Lake Zahl National Wildlife Refuge):
    Annual narrative report: Calendar year 2000",nt"tracking_summary": {ntt"total":
    1,ntt"recent": 1nt},nt"groups": [],nt"relationships_as_subject":
    [],nt"revision_timestamp": "2016-07-27T22:57:01.164735",nt"name": "crosby-wetland-management-district-including-lake-zahl-national-wildlife-refuge-annual-nar-c79fe",nt"isopen":
    false,nt"url": null,nt"notes": "This annual narrative report for Crosby
    National Wildlife Refuge outlines Refuge accomplishments during the 2000 calendar
    year. The report begins with a summary of the year's highlights and weather conditions.
    Land acquisition is covered. Refuge administration is outlined; information about
    personnel, youth programs, other manpower programs, volunteer programs, funding,
    safety, and technical assistance is given. Habitat management is also covered; subjects
    include wetlands, grasslands, grazing, haying, fire management, pest control, WPA
    easement monitoring, and private lands enhancement. The wildlife section of the
    report discusses endangered and threatened species, waterfowl, game mammals, and
    other resident wildlife. The public uses of the Refuge described in this report
    include interpretive programs, hunting, and law enforcement. The equipment and facilities
    section of the report provides information about equipment utilization and replacement.
    Cooperative programs and items of interest are provided at the end. A brief narrative
    report for Lake Zahl National Wildlife Refuge is included.",nt"license_title":
